"""
IPv4 Network Scanner Tool

Get each client device on a user defined subnet
so it can be used across all VLANs.
"""

import tkinter as tk
from tkinter import ttk
import subprocess, ipaddress, socket, threading, os, time, datetime, re, base64, tempfile
import concurrent.futures

# Global variables
selectedSubnet = ""
currentIPsScanned = 0

def scanIP(ip):
    macAddress = "N/A"
    hostname = "Unknown"
    try:
        ping_result = subprocess.run(["ping", "-n", "1", "-w", "100", ip], stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL, creationflags=subprocess.CREATE_NO_WINDOW)
        if ping_result.returncode == 0:
            try:
                arp_result = subprocess.run(["arp", "-a", ip], capture_output=True, text=True, timeout=2, creationflags=subprocess.CREATE_NO_WINDOW)
                if arp_result.returncode == 0:
                    for line in arp_result.stdout.splitlines():
                        if ip in line:
                            parts = line.split()
                            if len(parts) >= 2:
                                macAddress = parts[1]
                                break
            except Exception:
                macAddress = "N/A"
        try:
            hostname = socket.gethostbyaddr(ip)[0]
        except Exception:
            hostname = "Unknown"
    except Exception:
        pass
    return {"IP": ip, "Hostname": hostname, "MAC": macAddress}

def returnOnlySubnet(subnet):
    match = re.search(r"/\d+$", subnet)
    if match:
        cidr = match.group()
        cidr_number = match.group()[1:]
        return cidr_number
    else:
        return None

# Generate desktop file and give date/time in file name
def generateDesktopTxt(clients, root, ttk, selectedSubnet):
    desktopPath = os.path.join(os.path.expanduser("~"), "\\Desktop")
    with open (desktopPath + f"\\Desktop\\{selectedSubnet}_{datetime.datetime.now().strftime("%m-%d-%Y.%H-%M-%S")}_Scan-Output.txt", "w") as file:
        for client in clients:
            file.write(
                f"IP: {client['IP']}\n"
                f"Hostname: {client['Hostname']}\n"
                f"MAC: {client['MAC']}\n\n"
                "========================================="
                "\n"
            )
    time.sleep(2)
    completeFrame(root, ttk, selectedSubnet)

def scanSubnet(loadingBar, root, loadingLabel, selectedSubnet):
    global currentIPsScanned
    try:
        subnet = ipaddress.ip_network(selectedSubnet, strict=False)
        ipList = [str(ip) for ip in subnet.hosts()]
        totalIPs = len(ipList)
        res = []
        currentIPsScanned = 0

        def update_bar():
            percent = int((currentIPsScanned / totalIPs) * 100)
            loadingBar['value'] = percent
            root.update_idletasks()

        def ip_done(future):
            nonlocal res
            global currentIPsScanned
            res.append(future.result())
            currentIPsScanned += 1
            root.after(0, update_bar)

        with concurrent.futures.ThreadPoolExecutor(max_workers=20) as executor:
            futures = []
            for ip in ipList:
                future = executor.submit(scanIP, ip)
                future.add_done_callback(ip_done)
                futures.append(future)
            concurrent.futures.wait(futures)
        loadingLabel.config(text="Completeâœ… - Generating document...")
        root.update_idletasks()
        time.sleep(1)
        generateDesktopTxt(res, root, ttk, selectedSubnet)
    except ValueError as ve:
        return []

# Clear the current frame
def clearFrame(frame):
    for widget in frame.winfo_children():
        widget.destroy()

# Complete Window
def completeFrame(root, ttk, selectedSubnet):
    clearFrame(root)
    # Widget Frame (centered)
    contentFrame = ttk.Frame(root, padding = "20 20 20 20")
    contentFrame.grid(row=1, column=1, sticky="nsew")
    contentFrame.grid_columnconfigure(0, weight=1)
    
    # Complete Label
    completeLabel = ttk.Label(contentFrame, text=f"Scan of: {selectedSubnet} complete!")
    completeLabel.grid(row=0, column=0, pady=5)
    complete2Label = ttk.Label(contentFrame, text=f"The Txt output file is on the desktop.")
    complete2Label.grid(row=1, column=0, pady=5)

    # Reset globals
    global currentIPsScanned
    currentIPsScanned = 0

    # Return Button
    returnButton = ttk.Button(contentFrame, text="Finish", command=lambda: networkToolWindow(root))
    returnButton.grid(row=2, column=0, pady=10)


# Loading Window
def loadingFrame(root, ttk, selectedSubnet):
    clearFrame(root)
    # Widget Frame (centered)
    contentFrame = ttk.Frame(root, padding = "20 20 20 20")
    contentFrame.grid(row=1, column=1, sticky="nsew")
    contentFrame.grid_columnconfigure(0, weight=1)

    # Loading bar
    loadingLabel = ttk.Label(contentFrame, text=f"Scanning {selectedSubnet}...")
    loadingLabel.grid(row=0, column=0, pady=5)
    loadingBar = ttk.Progressbar(contentFrame, orient="horizontal", length=200, mode="determinate")
    loadingBar.grid(row=1, column=0, pady=5)

    root.update_idletasks()
    # Start scanSubnet in a new thread
    threading.Thread(target=scanSubnet, args=(loadingBar, root, loadingLabel, selectedSubnet), daemon=True).start()

# Main window function
def networkToolWindow(root):
    clearFrame(root)
    # Widget Frame (centered)
    contentFrame = ttk.Frame(root, padding = "20 20 20 20")
    contentFrame.grid(row=1, column=1, sticky="nsew")
    contentFrame.grid_columnconfigure(0, weight=1)

    subnet_var = tk.StringVar()
    enterSubnetText = ttk.Entry(contentFrame, width=30, textvariable=subnet_var)
    enterSubnetText.grid(row=1, column=0, pady=5)
    enterSubnetText.focus()
    enterSubnetText.bind("<Return>", lambda event: subnetSubmitButton.invoke())

    def on_var_change(*args):
        if subnet_var.get().strip():
            subnetSubmitButton.config(state="normal")
        else:
            subnetSubmitButton.config(state="disabled")

    subnet_var.trace_add("write", on_var_change)

    # Subnet Entry
    enterSubnetLabel = ttk.Label(contentFrame, text="Enter Subnet:")
    enterSubnetLabel.grid(row=0, column=0, pady=5)
    enterSubnetText = ttk.Entry(contentFrame, width=30)
    enterSubnetText.grid(row=1, column=0, pady=5)
    enterSubnetText.focus()
    enterSubnetText.bind("<Return>", lambda event: subnetSubmitButton.invoke())
    root.update_idletasks()

    # Submit Button
    subnetSubmitButton = ttk.Button(contentFrame, text="Scan", command=lambda: loadingFrame(root, ttk, enterSubnetText.get()))
    subnetSubmitButton.grid(row=2, column=0, pady=10)

iconBase64 = """

"""

def getTempIcon():
    icon_data = base64.b64decode(iconBase64)
    temp_icon = tempfile.NamedTemporaryFile(delete=False, suffix=".ico")
    temp_icon.write(icon_data)
    temp_icon.close()
    return temp_icon.name

def NetworkScanner():
    # Set up main window
    root = tk.Tk()
    root.title("ShadowCoding | Subnet Scanner")
    root.geometry("400x300")
    root.iconbitmap(getTempIcon())
    root.resizable(False, False)

    # Grid configuration for root
    root.grid_rowconfigure(0, weight=1) # Top padding
    root.grid_rowconfigure(1, weight=0) # Row for content
    root.grid_rowconfigure(2, weight=1) # Bottom padding
    root.grid_columnconfigure(0, weight=1) # Left padding
    root.grid_columnconfigure(1, weight=0) # Column for content
    root.grid_columnconfigure(2, weight=1) # Right padding

    networkToolWindow(root)
    root.mainloop()
    
if __name__ == "__main__":
    NetworkScanner()